import React from "react";
import Deck from "./Deck";

function DeckList({ deckList, cardList }) {
    return (
        <>
            <ul className={style={listStyle: "none"}}>
                {deckList.map(deck => <li key={deck.id}><Deck deck={deck} cardList={cardList}/></li>)}
            </ul>
        </>
    );
}

export default DeckList;
